problem_text:
Каждому из четырёх неравенств в левом столбце соответствует одно из решений в правом столбце. Установите соответствие между неравенствами и~их решениями.


\begin{center}
\hyphenpenalty=10000\renewcommand{\arraystretch}{1.5}
\begin{tabularx}{\textwidth}{{>{\raggedright}X>{\raggedright\arraybackslash}X}}
\multicolumn{1}{C}{НЕРАВЕНСТВА} & \multicolumn{1}{C}{РЕШЕНИЯ} \\
А) $x^{2}+11x-12\le 0$ & 1) $-1\le x \le 12$ \\ 
Б) $x^{2}-11x-12\le 0$ & 2) $-12\le x \le 1$ \\ 
В) $x^{2} +7x+12\ge 0$ & 3) $x \le 3$ или $x \ge 4$ \\ 
Г) $x^{2} -7x+12\ge 0$ & 4) $x \le -4$ или $x \ge -3$ \\ 
\end{tabularx}\end{center}\vspace{\medskip}

Впишите в приведённую в ответе таблицу под каждой буквой соответствующий номер решения.

\vspace{\baselineskip}\begin{tabular}{|*{4}{C|}} \hline А & Б & В & Г \\ \hline & & &  \\ \hline\end{tabular}\end{center}\vspace{\medskip}

Число $m$ равно $\sqrt{2,2} $.

Каждому из четырёх чисел в левом столбце соответствует отрезок, которому оно принадлежит. Установите соответствие между числами и отрезками из правого столбца.


\begin{center}
\hyphenpenalty=10000
\renewcommand{\arraystretch}{2}
\begin{tabularx}{\textwidth}{{>{\raggedright}X>{\raggedright\arraybackslash}X}} 
\multicolumn{1}{c}{ЧИСЛА} & \multicolumn{1}{c}{ОТРЕЗКИ} \\
А) $3+m$ & 1) $\left[ 0;1 \right]$ \\ 
Б) $\dfrac{2}{m} $ & 2) $\left[ 1;2 \right]$ \\ 
В) $\sqrt{2-m} $ & 3) $\left[ 2;3 \right]$ \\ 
Г) $m^{2} $ & 4) $\left[ 4;5 \right]$ \\
\end{tabularx}\end{center}\vspace{\medskip}

Впишите в приведённую в ответе таблицу под каждой буквой соответствующий отрезку номер.

\vspace{\baselineskip}\begin{tabular}{|*{4}{C|}} \hline А & Б & В & Г  \\ \hline & & &  \\ \hline\end{tabular}\end{center}\vspace{\medskip}

