В очереди в школьный буфет стоят Вера, Соня, Вася, Денис и Аня. Вера стоит впереди Сони, но после Ани; Вася и Аня не стоят рядом; Денис не~находится ни рядом с Аней, ни с Верой, ни с Васей.
Выберите утверждения, которые верны при приведённом условии.

\vspace{\medskip}
\begin{tabular}{p{0.2cm}l} 
1) & Вася стоит впереди Дениса.\\ 
2) & Соня и Вася стоят рядом.\\ 
3) & Вера стоит позади Дениса.\\ 
4) & Аня стоит позади Васи.\\ 
\end{tabular}

