В обменном пункте можно совершить одну из двух операций:

\begin{itemize}
\item  за 5 золотых монет получить 7 серебряных и одну медную;

\item  за 10 серебряных монет получить 7 золотых и одну медную.
\end{itemize}

У Николая были только серебряные монеты. После нескольких посещений обменного пункта серебряных монет у него стало меньше, золотых не появилось, зато появилось 60 медных. На сколько уменьшилось количество серебряных монет у Николая?

В фирме работают 100 человек, из них 70 человек знают португальский язык, а 50~--- французский. Выберите утверждения, которые верны при указанных условиях.

\begin{center}
\begin{tabularx}{\textwidth}{p{0.1cm}X}  
1) & В этой фирме хотя бы пять человек знают и португальский, и французский языки. \\ 
2) & Нет ни одного человека в этой фирме, знающего и португальский, и французский языки. \\ 
3) & Если человек из этой фирмы знает португальский язык, то он знает и французский. \\ 
4) & Не более 50 человек из этой фирмы знают и португальский, и французский языки. \\ 
\end{tabularx}\end{center}

В ответе запишите номера выбранных утверждений без пробелов, запятых и~других дополнительных символов.

